l): a six-digit unique number that defines each transaction. The letter “C” in the code indicates a cancellation.\n","* Date (numeric): the date when each transaction was generated.\n","* ProductNo (categorical): a five or six-digit unique character used to identify a specific product.\n","* Product (categorical): product/item name.\n","* Price (numeric): the price of each product per unit in pound sterling (£).\n","* Quantity (numeric): the quantity of each product per transaction. Negative values related to cancelled transactions.\n","* CustomerNo (categorical): a five-digit unique number that defines each customer.\n","* Country (categorical): name of the country where the customer resides.\n","\n","# PROCESS PHASE \n"]},{"cell_type":"markdown","id":"f939c6ce","metadata":{"papermill":{"duration":0.008266,"end_time":"2022-11-21T07:58:23.503227","exception":false,"start_time":"2022-11-21T07:58:23.494961","status":"completed"},"tags":[]},"source":["We will load the libraries and the data"]},{"cell_type":"code","execution_count":2,"id":"60473393","metadata":{"execution":{"iopub.execute_input":"2022-11-21T07:58:23.550481Z","iopub.status.busy":"2022-11-21T07:58:23.521497Z","iopub.status.idle":"2022-11-21T07:58:24.039932Z","shell.execute_reply":"2022-11-21T07:58:24.038016Z"},"papermill":{"duration":0.53141,"end_time":"2022-11-21T07:58:24.042815","exception":false,"start_time":"2022-11-21T07:58:23.511405","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package